  onMount(() => {
    drawCourt();
    plotPoints();
  });

  function drawCourt() {
    const svg = d3.select("#court")
      .attr("width", width)
      .attr("height", height);

    const xScale = d3.scaleLinear()
      .domain([-470, 470])
      .range([0, width]);

    const yScale = d3.scaleLinear()
      .domain([-250, 250])
      .range([height, 0]);

    // basketball court outline
    svg.append("rect")
      .attr("x", xScale(-470))
      .attr("y", yScale(250))
      .attr("width", xScale(470) - xScale(-470))
      .attr("height", yScale(-250) - yScale(250))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    // center circle
    svg.append("circle")
      .attr("cx", xScale(0))
      .attr("cy", yScale(0))
      .attr("r", xScale(60) - xScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    // free throw circles
    svg.append("circle")
      .attr("cx", xScale(-280))
      .attr("cy", yScale(0))
      .attr("r", xScale(60) - xScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("circle")
      .attr("cx", xScale(280))
      .attr("cy", yScale(0))
      .attr("r", xScale(60) - xScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("rect")
      .attr("x", xScale(280))
      .attr("y", yScale(90))
      .attr("width", xScale(190) - xScale(0))
      .attr("height", yScale(-180) - yScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("rect")
      .attr("x", xScale(-470))
      .attr("y", yScale(90))
      .attr("width", xScale(190) - xScale(0))
      .attr("height", yScale(-180) - yScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("line")
      .attr("x1", xScale(-430))
      .attr("y1", yScale(20))
      .attr("x2", xScale(-430))
      .attr("y2", yScale(-20))
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("line")
      .attr("x1", xScale(430))
      .attr("y1", yScale(20))
      .attr("x2", xScale(430))
      .attr("y2", yScale(-20))
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("circle")
      .attr("cx", xScale(-410))
      .attr("cy", yScale(0))
      .attr("r", xScale(18) - xScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("circle")
      .attr("cx", xScale(410))
      .attr("cy", yScale(0))
      .attr("r", xScale(18) - xScale(0))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("line")
      .attr("x1", xScale(-470))
      .attr("y1", yScale(220))
      .attr("x2", xScale(-330))
      .attr("y2", yScale(220))
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("line")
      .attr("x1", xScale(-470))
      .attr("y1", yScale(-220))
      .attr("x2", xScale(-330))
      .attr("y2", yScale(-220))
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("path")
      .attr("d", d3.arc()
        .innerRadius(xScale(237.5) - xScale(0))
        .outerRadius(xScale(237.5) - xScale(0))
        .startAngle(0.38)
        .endAngle(Math.PI / 1.134))
      .attr("transform", `translate(${xScale(-417.5)}, ${yScale(0)})`)
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("line")
      .attr("x1", xScale(330))
      .attr("y1", yScale(220))
      .attr("x2", xScale(470))
      .attr("y2", yScale(220))
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("line")
      .attr("x1", xScale(330))
      .attr("y1", yScale(-220))
      .attr("x2", xScale(470))
      .attr("y2", yScale(-220))
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("path")
      .attr("d", d3.arc()
        .innerRadius(xScale(237.5) - xScale(0))
        .outerRadius(xScale(237.5) - xScale(0))
        .startAngle(-0.38)
        .endAngle(-Math.PI / 1.134))
      .attr("transform", `translate(${xScale(417.5)}, ${yScale(0)})`)
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    // key areas
    svg.append("rect")
      .attr("x", xScale(-280))
      .attr("y", yScale(-60))
      .attr("width", xScale(20) - xScale(0))
      .attr("height", yScale(0) - yScale(-60))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    svg.append("rect")
      .attr("x", xScale(280))
      .attr("y", yScale(-60))
      .attr("width", xScale(20) - xScale(0))
      .attr("height", yScale(0) - yScale(-60))
      .style("fill", "none")
      .style("stroke", "black")
      .style("stroke-width", 2);

    // midcourt line
    svg.append("line")
      .attr("x1", xScale(0))
      .attr("y1", yScale(250))
      .attr("x2", xScale(0))
      .attr("y2", yScale(-250))
      .style("stroke", "black")
      .style("stroke-width", 2);
  }

  function plotPoints() {
  const width = 940;
  const height = 500;

  const svg = d3.select("#court")
    .attr("width", width)
    .attr("height", height);

  const xScaleANT = d3.scaleLinear()
    .domain([-470, 470])
    .range([0, width]);

  const yScaleANT = d3.scaleLinear()
    .domain([-250, 250])
    .range([height, 0]);

  const xScaleMJ = d3.scaleLinear()
    .domain([-470, 470])
    .range([0, width]);

  const yScaleMJ = d3.scaleLinear()
    .domain([-250, 250])
    .range([height, 0]);

  svg.selectAll("circle.shot.ant")
    .data(ANTshotData)
    .enter()
    .append("circle")
    .attr("class", "shot ant")
    .attr("cx", d => xScaleANT(d.LOC_Y) - width / 2.25)
    .attr("cy", d => yScaleANT(d.LOC_X))
    .attr("r", 5)
    .style("fill", "red")
    .style("opacity", 0.6);

  svg.selectAll("circle.shot.mj")
    .data(MJshotData)
    .enter()
    .append("circle")
    .attr("class", "shot mj")
    .attr("cx", d => xScaleMJ(-d.LOC_Y) + width / 2.25)
    .attr("cy", d => yScaleMJ(d.LOC_X))
    .attr("r", 5)
    .style("fill", "blue")
    .style("opacity", 0.6);
}
